import React from 'react';
import classes from './Footer.module.css'

const footer = (props) => (
  <footer className={classes.Footer}>
    <h2>FOOTER</h2>
  <i class="fa fa-linkedin-square" style="font-size:48px;color:red"></i>
  </footer>
)

export default footer;
